        selectedPlayers = {}
        selectedPlayersLabel.Text = "Nenhum jogador selecionado"
        updatePlayersList()
    end)
    
    -- Funo para atualizar lista de jogadores
    local function updatePlayersList()
        -- Limpar lista anterior (mantendo apenas os elementos fixos)
        for i, child in ipairs(playersFrame:GetChildren()) do
            if child:IsA("TextButton") and child ~= clearSelectionBtn then
                child:Destroy()
            end
        end
        
        -- Adicionar botes para cada jogador
        local yPosition = 100
        for _, playerName in ipairs(playerNames) do
            local playerBtn = Instance.new("TextButton", playersFrame)
            playerBtn.Text = playerName
            playerBtn.Size = UDim2.new(0.9, 0, 0, 30)
            playerBtn.Position = UDim2.new(0.05, 0, 0, yPosition)
            playerBtn.BackgroundColor3 = Color3.fromRGB(45, 45, 45)
            playerBtn.TextColor3 = Color3.new(1, 1, 1)
            playerBtn.Font = Enum.Font.Gotham
            playerBtn.TextSize = 12
            playerBtn.AutoButtonColor = true
            
            Instance.new("UICorner", playerBtn).CornerRadius = UDim.new(0, 4)
            
            local isSelected = table.find(selectedPlayers, playerName)
            if isSelected then
                playerBtn.BackgroundColor3 = Color3.fromRGB(80, 45, 110)
            end
            
            playerBtn.MouseButton1Click:Connect(function()
                if table.find(selectedPlayers, playerName) then
                    for i, name in ipairs(selectedPlayers) do
                        if name == playerName then
                            table.remove(selectedPlayers, i)
                            break
                        end
                    end
                else
                    table.insert(selectedPlayers, playerName)
                end
                
                -- Atualizar label
                if #selectedPlayers > 0 then
                    selectedPlayersLabel.Text = "Selecionados: " .. table.concat(selectedPlayers, ", ")
                else
                    selectedPlayersLabel.Text = "Nenhum jogador selecionado"
                end
                
                updatePlayersList()
            end)
            
            yPosition = yPosition + 35
        end
    end

    -- Atualizar lista de jogadores automaticamente
    Players.PlayerAdded:Connect(function(plr)
        table.insert(playerNames, plr.Name)
        updatePlayersList()
    end)

    Players.PlayerRemoving:Connect(function(plr)
        for i, name in ipairs(playerNames) do
            if name == plr.Name then
                table.remove(playerNames, i)
                break
            end
        end
        for i, name in ipairs(selectedPlayers) do
            if name == plr.Name then
                table.remove(selectedPlayers, i)
                break
            end
        end
        updatePlayersList()
        if #selectedPlayers > 0 then
            selectedPlayersLabel.Text = "Selecionados: " .. table.concat(selectedPlayers, ", ")
        else
            selectedPlayersLabel.Text = "Nenhum jogador selecionado"
        end
    end)

    -- Funo para executar comandos nos jogadores selecionados
    local function executeOnSelectedPlayers(command)
        if #selectedPlayers > 0 then
            for _, playerName in ipairs(selectedPlayers) do
                SendCommand(command .. " " .. playerName)
            end
        else
            -- Se nenhum jogador selecionado, executa no prprio jogador
            SendCommand(command .. " " .. LocalPlayer.Name)
        end
    end

    -- ADICIONAR COMANDOS  INTERFACE
    
    -- Boto Verifique
    createButton(cmdFrame, "Verifique", function()
        SendCommand(";verifique")
    end)

    -- Comandos bsicos
    createButton(cmdFrame, "Kill cmd", function() executeOnSelectedPlayers(";kill") end)
    createButton(cmdFrame, "Kill Plus", function() 
        if #selectedPlayers > 0 then
            for _, playerName in ipairs(selectedPlayers) do
                local player = Players:FindFirstChild(playerName)
                if player then
                    KillPlus(player)
                end
            end
        else
            KillPlus(LocalPlayer)
        end
    end)
    createButton(cmdFrame, "Kick cmd", function() executeOnSelectedPlayers(";kick") end)
    createButton(cmdFrame, "Crash cmd", function() executeOnSelectedPlayers(";crash") end)
    createButton(cmdFrame, "Bring cmd", function() executeOnSelectedPlayers(";bring") end)
    createButton(cmdFrame, "Fling cmd", function() executeOnSelectedPlayers(";fling") end)
    createButton(cmdFrame, "Freeze cmd", function() executeOnSelectedPlayers(";freeze") end)
    createButton(cmdFrame, "Unfreeze cmd", function() executeOnSelectedPlayers(";unfreeze") end)
    createButton(cmdFrame, "Jail cmd", function() executeOnSelectedPlayers(";jail") end)
    createButton(cmdFrame, "Unjail cmd", function() executeOnSelectedPlayers(";unjail") end)
    createButton(cmdFrame, "Explodir cmd", function() executeOnSelectedPlayers(";explodir") end)

    -- Comandos de Backrooms
    createButton(terrorFrame, " BACKROOMS", function() 
        if #selectedPlayers > 0 then
            for _, playerName in ipairs(selectedPlayers) do
                SendCommand(";backrooms " .. playerName)
            end
        else
            SendCommand(";backrooms " .. LocalPlayer.Name)
        end
    end)

    createButton(terrorFrame, " VOLTAR DO BACKROOMS", function() 
        if #selectedPlayers > 0 then
            for _, playerName in ipairs(selectedPlayers) do
                SendCommand(";unbackrooms " .. playerName)
            end
        else
            SendCommand(";unbackrooms " .. LocalPlayer.Name)
        end
    end)

    -- Comandos de terror
    createButton(terrorFrame, "Jumpscare 1", function() executeOnSelectedPlayers(";jumps1") end)
    createButton(terrorFrame, "Jumpscare 2", function() executeOnSelectedPlayers(";jumps2") end)
    createButton(terrorFrame, "Jumpscare 3", function() executeOnSelectedPlayers(";jumps3") end)
    createButton(terrorFrame, "Jumpscare 4", function() executeOnSelectedPlayers(";jumps4") end)
    
    -- Funo para trocar de aba
    local function switchTab(tab)
        cmdFrame.Visible = (tab == "cmds")
        terrorFrame.Visible = (tab == "terror")
        playersFrame.Visible = (tab == "players")
        
        -- Resetar todas as abas
        btnTabCmds.Font = Enum.Font.Gotham
        btnTabCmds.BackgroundColor3 = Color3.fromRGB(40, 40, 40)
        btnTabCmds.TextColor3 = Color3.new(0.8, 0.8, 0.8)
        
        btnTabTerror.Font = Enum.Font.Gotham
        btnTabTerror.BackgroundColor3 = Color3.fromRGB(40, 40, 40)
        btnTabTerror.TextColor3 = Color3.new(0.8, 0.8, 0.8)
        
        btnTabPlayers.Font = Enum.Font.Gotham
        btnTabPlayers.BackgroundColor3 = Color3.fromRGB(40, 40, 40)
        btnTabPlayers.TextColor3 = Color3.new(0.8, 0.8, 0.8)
        
        -- Destacar aba ativa
        if tab == "cmds" then
            btnTabCmds.Font = Enum.Font.GothamBold
            btnTabCmds.BackgroundColor3 = Color3.fromRGB(60, 60, 60)
            btnTabCmds.TextColor3 = Color3.new(1, 1, 1)
        elseif tab == "terror" then
            btnTabTerror.Font = Enum.Font.GothamBold
            btnTabTerror.BackgroundColor3 = Color3.fromRGB(60, 60, 60)
            btnTabTerror.TextColor3 = Color3.new(1, 1, 1)
        elseif tab == "players" then
            btnTabPlayers.Font = Enum.Font.GothamBold
            btnTabPlayers.BackgroundColor3 = Color3.fromRGB(60, 60, 60)
            btnTabPlayers.TextColor3 = Color3.new(1, 1, 1)
        end
    end
    
    -- Sistema de minimizar
    local minimized = false
    btnMin.MouseButton1Click:Connect(function()
        minimized = not minimized
        body.Visible = not minimized
        tabContainer.Visible = not minimized
        if minimized then
            panel.Size = UDim2.new(0, 180, 0, 36)
            btnMin.Text = ""
        else
            panel.Size = fullSz
            btnMin.Text = "_"
        end
    end)
    
    -- Conectar eventos dos botes de tab
    btnTabCmds.MouseButton1Click:Connect(function() switchTab("cmds") end)
    btnTabTerror.MouseButton1Click:Connect(function() switchTab("terror") end)
    btnTabPlayers.MouseButton1Click:Connect(function() switchTab("players") end)
    
    -- Iniciar na aba de comandos
    switchTab("cmds")
    
    -- Atualizar lista de jogadores inicial
    updatePlayersList()
    
    return screen
end

